import React from "react";
import './Apresentacao.css';
import imagemApresentacao from '../Imagens/Imagem_inicial.png';


function Apresentacao(){


    return(
        <div className="body">
            <div className=""></div>
            <div className="imgApresentacao">
                <img src={imagemApresentacao} alt='Imagem ilustrativa de nosso produto.'/>
            </div>

            <div className="textoApresentacao">
                <h1>Bem vindo à Tempfy</h1>

                <p>Neste aplicativo você poderá controlar seus aparelhos Tempfy.Para começar, clique em “Login” caso já possua uma conta ou em “Cadastrar”</p>
            </div>

            <div className="btns">
                <button>Login</button>
                <button>Cadastrar</button>
            </div>
        </div>
    )

}

export default Apresentacao;
